import { createStyles, makeStyles, Theme } from "@material-ui/core";
import React from "react";
import {
  Button,
  Form,
  FormGroup,
  Input,
  Label,
  Row,
} from "reactstrap";
import styled from "styled-components";

import * as Styled from './Contact.style'

function Contact() {

  const useStyles = makeStyles((theme: Theme) =>
    createStyles({
      root: {
        '& .MuiTextField-root': {
          margin: theme.spacing(1),
          width: '25ch',
        },
      },
    }),
  );
  
  return (
    <Styled.Container>
    <Row>
        <Styled.Title>
            <h1>CONTÁCTENOS</h1>
        </Styled.Title>
    </Row>
    <Styled.FormContainer>
      <form className={classes.root} noValidate autoComplete="off">
          <FormGroup>
            <Label for="nameInput">Nombre</Label>
            <Input type="text" name="name" id="nameInput" placeholder="Ingrese su nombre completo" />
          </FormGroup>
          <FormGroup>
            <Label for="emailInput">Correo electrónico</Label>
            <Input type="email" name="email" id="emailInput" placeholder="Ingrese su correo electrónico" />
          </FormGroup>
          <FormGroup>
            <Label for="messageInput">Mensaje</Label>
            <Input type="textarea" name="text" id="messageInput" />
          </FormGroup>
          <Button>Enviar</Button>
        <Styled.ContactContainer>
          <p><span></span> 2268-0044 </p>
          <p><span></span> soporte@iot3k.com </p>
        </Styled.ContactContainer>
      </form>
    </Styled.FormContainer>
</Styled.Container>
  )
}

export default Contact
